/// Map from codepage to decoding table
///
/// `.get` returns `code_table_type::{Complete,Incomplete}`:
///
/// * `Complete`: the decoding table doesn't have any undefined mappings.
/// * `Incomplete`: it has some undefined mappings.
///
/// This enumerate provides methods `decode_string_lossy` and `decode_string_checked`.
/// The following examples show the use of them.  `if let Some(decoder) = *snip* decoder.decode_string_*snip*` is convenient for practical use.
///
/// # Examples
///
/// ```
/// use oem_cp::code_table::{DECODING_TABLE_CP_MAP, DECODING_TABLE_CP437};
/// use oem_cp::code_table_type::TableType::*;
/// assert_eq!(DECODING_TABLE_CP_MAP.get(&437).unwrap().decode_string_lossy(&[0x31, 0xF6, 0xAB, 0x3D, 0x32]), "1÷½=2".to_string());
/// if let Some(cp874_table) = DECODING_TABLE_CP_MAP.get(&874) {
///     // means shrimp in Thai (U+E49 => 0xE9)
///     assert_eq!(cp874_table.decode_string_checked(&[0xA1, 0xD8, 0xE9, 0xA7]), Some("กุ้ง".to_string()));
///     // undefined mapping 0xDB for CP874 Windows dialect (strict mode with MB_ERR_INVALID_CHARS)
///     assert_eq!(cp874_table.decode_string_checked(&[0xDB]), None);
/// } else {
///     panic!("CP874 must be defined in DECODING_TABLE_CP_MAP");
/// }
/// ```
pub static DECODING_TABLE_CP_MAP: OEMCPHashMap<u16, TableType> = ::phf::Map {
    key: 8694567506910003252,
    disps: &[
        (0, 17),
        (7, 6),
        (9, 4),
        (0, 0),
    ],
    entries: &[
        (775, Complete(&DECODING_TABLE_CP775)),
        (720, Complete(&DECODING_TABLE_CP720)),
        (869, Complete(&DECODING_TABLE_CP869)),
        (858, Complete(&DECODING_TABLE_CP858)),
        (865, Complete(&DECODING_TABLE_CP865)),
        (862, Complete(&DECODING_TABLE_CP862)),
        (857, Incomplete(&DECODING_TABLE_CP857)),
        (861, Complete(&DECODING_TABLE_CP861)),
        (437, Complete(&DECODING_TABLE_CP437)),
        (863, Complete(&DECODING_TABLE_CP863)),
        (850, Complete(&DECODING_TABLE_CP850)),
        (737, Complete(&DECODING_TABLE_CP737)),
        (864, Incomplete(&DECODING_TABLE_CP864)),
        (874, Incomplete(&DECODING_TABLE_CP874)),
        (866, Complete(&DECODING_TABLE_CP866)),
        (860, Complete(&DECODING_TABLE_CP860)),
        (855, Complete(&DECODING_TABLE_CP855)),
        (852, Complete(&DECODING_TABLE_CP852)),
    ],
};

